: tcp://172.21.0.160:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 64 &lt;/li&gt;\n          &lt;li&gt; Threads: 1536 &lt;/li&gt;\n          &lt;li&gt; Memory: 10.80 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr, timeout=60, heartbeat_interval=10)\n    return client\n\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n# Get client\nclient = connect(scheduler_info)\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    # Construct a lazy task graph \n    print(\"gt array\", gt, flush=True)\n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt)\n    print(\"result \", client.compute(s).result(), flush=True)       \n\nprint(\"Done in \", time.time() - t, flush=True)\nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"tabs":[{"id":"1402"},{"id":"1406"},{"id":"1409"},{"id":"1410"},{"id":"1403"},{"id":"1404"},{"id":"1405"},{"id":"1407"},{"id":"1408"}]},"id":"1411","type":"Tabs"},{"attributes":{},"id":"1078","type":"DataRange1d"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1394"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1396"},"nonselection_glyph":{"id":"1395"},"view":{"id":"1398"}},"id":"1397","type":"GlyphRenderer"},{"attributes":{},"id":"1482","type":"AllLabels"},{"attributes":{"months":[0,6]},"id":"1332","type":"MonthsTicker"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{},"id":"1484","type":"DatetimeTickFormatter"},{"attributes":{"coordinates":null,"data_source":{"id":"1038"},"glyph":{"id":"1067"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1069"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1071"}},"id":"1070","type":"GlyphRenderer"},{"attributes":{},"id":"1485","type":"AllLabels"},{"attributes":{"coordinates":null,"group":null,"text":"Number of File Descriptors"},"id":"1369","type":"Title"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"1326","type":"DaysTicker"},{"attributes":{},"id":"1448","type":"AllLabels"},{"attributes":{},"id":"1319","type":"AllLabels"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right
